  false,\n\t\"url\": null,\n\t\"notes\": \"Since the last vegetative survey in 1965,
  the marsh at Canvasback Gun Club has remained virtually unchanged. The Arthur-Johnson
  Ponds produced most of the waterfowl food. Dutch Bill Lake, Big Mallard Lake and
  Freeman Lakes were practically barren of submergent vegetation. The purpose of the
  survey was to determine species composition, relative abundance and distribution
  of submergents in the Canvasback Gun Club in Nevada.\",\n\t\"license_title\": \"License
